import React from 'react';
import Game from './Game'
import QuestionList from './Game'
import NameForm from './Game'


class App extends React.Component {
  render(){
    return (
      <div>
        <h1>Lutrivia</h1>
        <Game/>
        <QuestionList/>
        <NameForm/>
      </div>
    )
  }
}

export default App;
